type 'a node = {
  value : 'a;
  mutable next : 'a Q.node option;
  mutable prev : 'a Q.node option;
}

type step = {
  duration : duration;
  rusage : rusage;
  ocaml_gc : ocaml_gc;
  index : 'a;
  pack_store : Pack_store.t;
  inode : 'b;
}

